import { FunctionComponent, useContext } from "react";
import { NavLink, useNavigate } from "react-router-dom";

interface NavbarProps {
  setUserInfo: Function;
  userInfo: any;
  darkMode: any;
  setDarkMode: Function;
}

const Navbar: FunctionComponent<NavbarProps> = ({
  setUserInfo,
  userInfo,
  darkMode,
  setDarkMode,
}) => {
  let theme = useContext(SiteTheme);

  let navigate = useNavigate();
  let render = () => setUserInfo(!userInfo);

  let logout = () => {
    sessionStorage.removeItem("userInfo");
    navigate("/home");
    render();
  };
  return (
    <>
      <nav className="navbar navbar-expand-lg pt-0">
        <div className="container-fluid" style={{ backgroundColor: "#D4E2D4" }}>
          <NavLink to={"/home"} className="navbar-brand">
            <img src="/logo.png" alt="" width="60" height="44" />
          </NavLink>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarTogglerDemo03"
            aria-controls="navbarTogglerDemo03"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarTogglerDemo03">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <NavLink className="nav-link" aria-current="page" to="/aboutSniffle">
                  About Sniffle
                </NavLink>
              </li>

              {/**** business user menu****/}
              {userInfo.role === "business" && (
                <li className="nav-item">
                  <NavLink className="nav-link" aria-current="page" to="/user-cards">
                    My cards
                  </NavLink>
                </li>
              )}
              {(userInfo.role === "business" || userInfo.role === "user") && (
                <li className="nav-item">
                  <NavLink className="nav-link " aria-current="page" to="favorites">
                    My favorite
                  </NavLink>
                </li>
              )}
            </ul>

            <ul className="navbar-nav justify-content-end ">
              <div className="form-check form-switch ">
                <input
                  className="form-check-input align-middle"
                  type="checkbox"
                  role="switch"
                  id="flexSwitchCheckDefault"
                  onChange={() => setDarkMode(!darkMode)}
                />
                <label className="form-check-label" htmlFor="flexSwitchCheckDefault">
                  <i className="fa-solid fa-circle-half-stroke "></i>
                </label>
              </div>
              {!userInfo.role && (
                <>
                  <li className="nav-item">
                    <NavLink className="nav-link" to="/login">
                      Login
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to="/register">
                      Register
                    </NavLink>
                  </li>
                </>
              )}
              <form className="">
                <div className="input-group  d-flex ms-2">
                  <div id="navbar-search-autocomplete" className="form-outline">
                    <input type="search" id="form1" className="form-control" placeholder="Search" />
                  </div>
                  <button
                    type="button"
                    className="btn mb-1 "
                    style={{ backgroundColor: "#DF7861" }}
                  >
                    <i className="fas fa-search"></i>
                  </button>
                </div>
              </form>{" "}
              {/***** only registered user *******/}
              {userInfo.firstName && (
                <>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={"/home"} onClick={logout}>
                      Logout
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={`/user-profile/${userInfo.userId}`}>
                      <i className="fa-solid fa-user"></i>
                    </NavLink>
                  </li>
                </>
              )}
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
